import React, { useState, useEffect } from "react";
import { Card } from 'react-bootstrap';
import { getVehiclesByReportNumber, getDriversByVehicleNumber } from "../api/api";

export default function CrashCard({ crash }) {
    // get vehicle, driver with this report_number

    const [vehicles, setVehicles] = useState(null);


    const init = () => {
        getVehiclesByReportNumber(crash.report_number).then(vehicleData => {
            let vehicles = vehicleData;
            getDriversByVehicleNumber(crash.report_number, vehicleData.vehicle_number).then(driverData => {
                vehicles = [...vehicleData, driverData];
                setVehicles({
                    vehicles: vehicles
                });
            })
        });
    };

    useEffect(() => {
        init();
    }, []);

    let crashDetail = {
        road: crash.road,
        county: crash.county,
        crash_severity: crash.crash_severity,
    }
    return (
        <Card style={{ width: '18rem' }}>
            <Card.Header>{crash.crash_severity}| {crash.on_street} @ {crash.city}, {crash.county}</Card.Header>
            <Card.Body>
                <Card.Title></Card.Title>
                <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
                <Card.Text>
                    Some quick example text to build on the card title and make up the bulk of
                    the card's content.
    </Card.Text>
                <Card.Link href="#">Card Link</Card.Link>
                <Card.Link href="#">Another Link</Card.Link>
            </Card.Body>
        </Card>
    );
};
